import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the view toggle buttons to appear (by class and title)
    await page.waitForSelector('.view-toggle', { timeout: 5000 });

    // Try to find the "List View" button by its title attribute
    const listViewBtn = await page.$('button.view-btn[title="List View"]');
    if (!listViewBtn) {
      throw new Error('List View button not found');
    }

    // Click the List View button
    await listViewBtn.click();

    // Wait for the products-list container to appear (list view mode)
    await page.waitForSelector('.products-list', { timeout: 5000 });

    // Take screenshot after switching to list view
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_list_view.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_list_view.png'));

    // Extract the number of products displayed in list view
    const productCards = await page.$$('.products-list .product-card-list');
    const productCount = productCards.length;

    return {
      success: true,
      action: "Switched to List View Mode by clicking the List View button",
      extractedData: {
        listViewActive: true,
        productCount
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
